import React ,{useEffect}from "react"
import {CardHomeStyle} from '../styled/CardStylr'
import Aos from 'aos';
import './HomeCard.css'
interface Props {
    title:string,
    desc:string,
    image_url:string
}
const HomeCard:React.FC <Props> = ({title,desc,image_url}) => {

    useEffect(()=>{
        Aos.init();
    },[])
    return (
        <CardHomeStyle >
            <img data-aos="fade-up"  className="img" src={image_url} alt={title} />
            <div className="card_info">
                <h2 className="title">{title} </h2>
                <p> {desc} </p>
            </div>
        </CardHomeStyle>
    )
}
export default HomeCard;
